import React, { Component } from "react";

class Header extends Component {
  render() {
    const navbarColor={backgroundColor :"rgb(0,0,0)"}
    return (
      <div className="navbar rounded padding " style={navbarColor}>
        <h1 className="text-white shadow-lg ">React App</h1>
      </div>
    );
  }
}

export default Header;
